import React from "react";

export function OverView() {
  return (
    <div className="flex items-center flex-col">
      <span className="font-semibold text-xl text-primary">
        Expense Tracker
      </span>
      <div className=" bg-secondary h-[50vh] w-[70vw] rounded-md shadow-lg mt-4 pt-4 px-4">
        <button type="button" className="bg-button px-3 py-2 rounded-[50px] float-right shadow-md text-">
          Add
        </button>
      </div>
    </div>
  );
}
